query IndexPage(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    frontmatter {
      title
      meta_title
      meta_description
      heading
      description
      offerings {
        blurbs {
          image
          text
        }
      }
      testimonials {
        author
        quote
      }
    }
  }
}

query PricingPage(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    frontmatter {
      title
      meta_title
      meta_description
      pricing {
        heading
        description
        plans {
          description
          items
          plan
          price
        }
      }
    }
  }
}

query ContactPage(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    frontmatter {
      title
      subtitle
      meta_title
      meta_description
      heading
      contacts {
        email
        description
      }
    }
  }
}

query AboutPage(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    html
    frontmatter {
      title
      meta_title
      meta_description
    }
  }
}

query ArticleByID(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    id
    html
    fields {
      slug
    }
    frontmatter {
      date(formatString: "MMMM DD, YYYY")
      title
      cover
      meta_title
      meta_description
      tags
    }
  }
}

query TagPage(
  $tag: String
) {
  site {
    siteMetadata {
      title
    }
  }
  allMarkdownRemark(limit: 1000, sort: {fields: [frontmatter___date], order: DESC}, filter: {frontmatter: {tags: {in: [$tag]}}}) {
    totalCount
    edges {
      node {
        fields {
          slug
        }
        frontmatter {
          title
        }
      }
    }
  }
}

query TagsQuery {
  site {
    siteMetadata {
      title
    }
  }
  allMarkdownRemark(limit: 1000) {
    group(field: frontmatter___tags) {
      fieldValue
      totalCount
    }
  }
}
